import React from 'react'
import data from '../db.json'

const Paginas = () => {
  return (
    <div>
        {data.map((pagina) =>  {
          return (    
            <>
            <h1>{pagina.cliente}</h1>
            <video width={720} height={600} controls src={pagina.linkVideo} type = "video/mp4"></video>
            </>
        );
    })}

    </div>
  )
}

export default Paginas;
